    false,nt"url": null,nt"notes": "Visual inspections of all five lakes and
    the Oyster Pond on St. Vincent National Wildlife Refuge were made in 1979.  It appeared
    that infestation of the lakes and the pond by cattails had become even more severe
    than was the case the previous fall when fish population sampling work was conducted.
    Besides cattails, Lake 5 and the Oyster Pond were found to be infested by American
    lotus. The open water areas of the lakes were also found to contain extensive growths
    of submerged aquatic vegetation. Cursory identification of the dominant forms (in
    order of decreasing dominance) included coontail (Ceratophyllum), musk grass (Chara),
    bladderwort (Utricularia), and sago pondweed (Potamogeton pectinatus).  A long term
    control program is recommended.",nt"license_title": "License Not Specified",nt"extras":
